css:
@-moz-document domain("coffeescript.org") {
body {
    color: #adc0d3;
    background-color: #044056;
}

.sidebar {
    background-color: #260e01;
    border-right: 1px solid #000;
}

code,
a > code {

    background-color: #0f96c5;
}

.main blockquote pre {
    background-color: #0f96c5;
}

.uneditable-code-block .comment {
    color: #FFF;
}
}
